import React from 'react';
import {Container, ImageOne, TextTitle} from './style.js';
import brainwave from '../../assets/brainwave.svg'
import globe from '../../assets/globe.svg'
import toprightBackground from '../../assets/toprightBackground.png'

function LandingPage() {
  return (
    <Container>
      <ImageOne>
        <img src={brainwave} alt="brainwave"/>
      </ImageOne>
      <TextTitle>
        <span className="textshadow">What We Do</span>
      </TextTitle>
    </Container>
  );
}

export default LandingPage;
